import { useState, useEffect } from "react";
import {getCourses} from "../../api"

function Courses() {
  const [courses, setCourses] = useState([]);
  useEffect(()=>{
    getCourses().then(
      (data) => {
        setCourses(data.Valute)
      }
    )
  }, []);


  console.log(courses);

  return (
    <section className="courses">
      <div className="container">
        <p>Курсы валют:</p>  
        {courses.map(courses => (
            <MealItem key={courses.Name} {...courses} />
        ))}
      </div>    
    </section>
  );
}

export { Courses };
